import React, { Component } from 'react';
import './App.scss';
import Header from './components/Header';
import Navbar from './components/Navbar';
import About from './components/About';
import Work from './components/Work';
import Contact from './components/Contact';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

console.log("testing");

export class App extends Component {
  render() {
    return (

      <Router>

      <section className="App">              
              <div id="outer-container">
                <Navbar pageWrapId={ "page-wrap" } outerContainerId={ "outer-container" } />
                <Menu isOpen={this.state.menuOpen} onStateChange={(state) => this.handleStateChange(state)} right width={ '100vw' } >
                <Link to="/" onClick={() => this.closeMenu()}>Home</Link>
                <Link to="/about" onClick={() => this.closeMenu()}>About</Link>
                <Link to="/work" onClick={() => this.closeMenu()}>Work</Link>
                <Link to="/contact" onClick={() => this.closeMenu()}>Contact</Link>           
            </Menu>

              </div>
      </section>  

      <Switch>
      <Route exact path="/" component={Header} />
      <Route exact path="/about" component={About} />
      <Route exact path="/work" component={Work} />
      <Route exact path="/contact" component={Contact} />
      </Switch>

      </Router>



    )
  }
}

export default App;
